import React from 'react';
import './dashboard_box.css';

const DashboardBox = ({ title, onClick }) => {


  return (
    <div className="dashboard-box" onClick={onClick}>
      <h2>{title}</h2>
    </div>
  );
};

export default DashboardBox;
